import React from "react";
import { Link } from "react-router-dom";
import NavbarCoord from "./navCoord";
import HomePage from "./Homepage";

export default function CoordPage() {
  return (
    <>
      <NavbarCoord />
      <HomePage />
    </>
  );
}

function Incoordpage() {
  return (
    <main
      className="container "
      style={{
        marginLeft: "40%",
        marginTop: "100px",
      }}
    >
      <div>
        <Link to="/Aulas">
          <button type="button" className="btn btn-primary btn-lg">
            Cadastrar/Excluir Aluno
          </button>
        </Link>
      </div>
      <div>
        <Link to="/Notas">
          <button
            type="button"
            className="btn btn-primary btn-lg"
            style={{ marginTop: "30px" }}
          >
            Cadastrar/Excluir Professor
          </button>
        </Link>
      </div>
      <div>
        <button
          type="button"
          className="btn btn-primary btn-lg"
          style={{ marginTop: "30px" }}
        >
          Cadastrar/Excluir Turma
        </button>
      </div>
      <div>
        <button
          type="button"
          className="btn btn-primary btn-lg"
          style={{ marginTop: "30px" }}
        >
          Lan√ßar/Editar Notas
        </button>
      </div>
      <div>
        <button
          type="button"
          className="btn btn-primary btn-lg"
          style={{ marginTop: "30px" }}
        >
          Falar com Professor/Aluno
        </button>
      </div>
    </main>
  );
}
